import React, { Component, Fragment } from "react";
import Post from "./Post";
import "./styles.scss";

export class Explore extends Component {
  constructor(props) {
    super(props);

    const post = [
      {
        id: 1,
        title: "paris",
        desc: "beautiful",
      },
      {
        id: 2,
        title: "chicago",
        desc: "busy",
      },
    ];

    this.state = {
      posts: post,
    };
  }

  render() {
    return (
      <Fragment>
        <h1>Explore</h1>
        <div className="card-container">
          {this.state.posts.map((p) => (
            <Post title={p.title} description={p.desc}></Post>
          ))}
        </div>
      </Fragment>
    );
  }
}

export default Explore;
